import React from 'react';
import { Box, Stack, Typography } from '@mui/material';

const SimilarRecipes = () => {
  return (
    <Box sx={{ mt: { lg: '100px', xs: '0' } }}>
      <Typography variant='h3'>Similar Recipes</Typography>
    </Box>
  )
}

export default SimilarRecipes
